import background from "./images/background-pattern-desktop.svg";
import "./App.css";
import { FAQCard } from "./FAQCard";

export const App = () => {
  return (
    <div className="App w-100 h-100">
      <img
        src={background}
        className="img-fluid w-100"
        alt="purple background with swirly lines"
      />
      <FAQCard />
    </div>
  );
};

export default App;
